The Devil in Miss Jones 6 (1999) [DVDRip]

CAST
Anita Cannibal, Chris Cannon, Crystal Crawford, Ian Daniels, J.J. Michaels, John Strong, Juli Ashton, Keri Windsor, Kyle Stone, Michael J. Cox, Nikita, Peris Bleau, Randy Spears, Stacy Valentine, Steve Hatcher, Tina Tyler, Vicca

DMJ6: Devil In Miss Jones 6: From Antonio Passolini, the writer/director of the acclaimed Cafe Flesh #2 (AVN Award, Best Video 1998), comes a vision of Hell-on-Earth unlike anything you've ever seen. It all starts when Justine Jones accidentally summons two sexual demons to Earth. As the two embark on a sexual rampage, Justine is recruited by Satan to hunt down the pair of errant she-devils and send them back to Hell. The trail is littered with a slew of sexual psychos - a trailer park nymphomaniac, a perverted beekeeper, a movie star and his latex nursie, and even a masked Mexican wrestling team who take on Justine and Satan in a no-holes barred grudge match! 

